import React, { useEffect, useState } from "react";
import axios from "axios";

const AddLecture = ({ onAdd }) => {
  const [title, setTitle] = useState("");
  const [courses, setCourses] = useState([]);
  const [instructors, setInstructors] = useState([]);
  const [courseId, setCourseId] = useState("");
  const [instructorId, setInstructorId] = useState("");
  const [message, setMessage] = useState("");

  const token = localStorage.getItem("adminToken");

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [cRes, iRes] = await Promise.all([
          axios.get("http://localhost:5000/api/admin/courses", {
            headers: { Authorization: `Bearer ${token}` },
          }),
          axios.get("http://localhost:5000/api/admin/instructors", {
            headers: { Authorization: `Bearer ${token}` },
          }),
        ]);
        setCourses(Array.isArray(cRes.data) ? cRes.data : []);
        setInstructors(Array.isArray(iRes.data) ? iRes.data : []);
      } catch (err) {
        console.error(err);
      }
    };
    fetchData();
  }, [token]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(
        "http://localhost:5000/api/admin/lectures",
        { title, courseId, instructorId },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setMessage("Lecture added successfully");
      setTitle("");
      setCourseId("");
      setInstructorId("");
      onAdd();
    } catch (err) {
      setMessage(err.response?.data?.message || "Failed to add lecture");
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        value={title}
        onChange={(e) => setTitle(e.target.value)}
        placeholder="Lecture Title"
        required
      />
      <select
        value={courseId}
        onChange={(e) => setCourseId(e.target.value)}
        required
      >
        <option value="">Select Course</option>
        {courses.map((c) => (
          <option key={c._id} value={c._id}>
            {c.name}
          </option>
        ))}
      </select>
      <select
        value={instructorId}
        onChange={(e) => setInstructorId(e.target.value)}
        required
      >
        <option value="">Select Instructor</option>
        {instructors.map((i) => (
          <option key={i._id} value={i._id}>
            {i.name}
          </option>
        ))}
      </select>
      <button type="submit">Add Lecture</button>
      {message && <p>{message}</p>}
    </form>
  );
};

export default AddLecture;
